import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
    const [students, setStudents] = useState([]);
    const [newStudent, setNewStudent] = useState({
        name: '',
        tasks: 0,
        exam: 0,
        project: 0,
        attendance: 0
    });

    useEffect(() => {
        axios.get('/api/students')
            .then(response => setStudents(response.data))
            .catch(error => console.log(error));
    }, []);

    const handleChange = (event) => {
        const { name, value } = event.target;
        setNewStudent(prevState => ({ ...prevState, [name]: value }));
    }

    const handleSubmit = (event) => {
        event.preventDefault();
        axios.post('/api/students', newStudent)
            .then(response => setStudents(prevState => [...prevState, response.data]))
            .catch(error => console.log(error));
        setNewStudent({
            name: '',
            tasks: 0,
            exam: 0,
            project: 0,
            attendance: 0
        });
    }

    const handleDelete = (id) => {
        axios.delete(`/api/students/${id}`)
            .then(response => setStudents(prevState => prevState.filter(student => student.id !== id)))
            .catch(error => console.log(error));
    }

    const handleEdit = (id) => {
        // code to handle editing a student's information
    }

    return (
        <div className="App">
            <h1>Students' Points Records</h1>
            <form onSubmit={handleSubmit}>
                <label>
                    Name:
                    <input type="text" name="name" value={newStudent.name} onChange={handleChange} />
                </label>
                <label>
                    Tasks:
                    <input type="number" name="tasks" value={newStudent.tasks} onChange={handleChange} />
                </label>
                <label>
                    Exam:
                    <input type="number" name="exam" value={newStudent.exam} onChange={handleChange} />
                </label>
                <label>
                    Project:
                    <input type="number" name="project" value={newStudent.project} onChange={handleChange} />
                </label>
                <label>
                    Attendance:
                    <input type="number" name="attendance" value={newStudent.attendance} onChange={handleChange} />
                </label>
                <button type="submit">Add Student</button>
            </form>
            <table>
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Tasks</th>
                        <th>Exam</th>
                        <th>Project</th>
                        <th>Attendance</th>
                        <th>Points</th>
                        <th>Actions</th>
                    </tr>
                </thead>
                <tbody>
                    {students.map(student => (
                        <tr key={student.id}>
                            <td>{student.name}</td>
                            <td>{student.tasks}</td>
                            <td>{student.exam}</td>
                            <td>{student.project}</td>
                            <td>{student.attendance}</td>
                            <td>{((student.tasks + student.exam + student.project + student.attendance) / 4).toFixed(2)}</td>
                            <td>
                                <button onClick={() => handleEdit(student.id)}>Edit</button>
                                <button onClick={() => handleDelete(student.id)}>Delete</button>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default App;
